import React, { useEffect } from 'react';
import './Services.css';

const Services = () => {
  useEffect(() => {
    const servicesItems = document.querySelectorAll('.services li');

    const observerOptions = {
      root: null, // viewport
      rootMargin: '0px',
      threshold: 0.5, // öğenin %50'si görünür olduğunda animasyonu başlat
    };

    const observer = new IntersectionObserver((entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate'); // Animasyonu başlat
        }
      });
    }, observerOptions);

    servicesItems.forEach((item) => observer.observe(item));

    return () => {
      servicesItems.forEach((item) => observer.unobserve(item)); // Cleanup
    };
  }, []);

  return (
    <section id="services" className="services">
      <h2>Hizmetlerimiz</h2>
      <ul>
        <li>
          <h3>Ceza Hukuku Hizmeti</h3>
          <p>Suçlamalarla karşı karşıya kaldığınızda, uzman ceza hukuku avukatlarımız sizin için savunma yapacaktır...</p>
        </li>
        <li>
          <h3>Aile Hukuku Hizmeti</h3>
          <p>Boşanma, mal paylaşımı, çocukların velayeti gibi hassas konularda hukuki desteğe mi ihtiyacınız var...</p>
        </li>
        <li>
          <h3>İş Hukuku Hizmeti</h3>
          <p>İş yerinde yaşadığınız hak ihlallerini ortadan kaldırmak için iş hukuku uzmanlarımız yanınızda...</p>
        </li>
        <li>
          <h3>Ticaret Hukuku Hizmeti</h3>
          <p>İşletmenizin yasal süreçlerini güvenle yönetin. Ticaret hukuku avukatlarımız, ticari sözleşmelerden...</p>
        </li>
        <li>
          <h3>İcra ve İflas Hukuku Hizmeti</h3>
          <p>Alacaklarınızı tahsil etmekte zorlanıyor musunuz? İcra ve iflas hukuku hizmetimiz, borçlulara karşı...</p>
        </li>
        <li>
          <h3>Gayrimenkul Hukuku Hizmeti</h3>
          <p>Gayrimenkul alım satım süreçlerinde yaşadığınız hukuki sorunları profesyonel bir şekilde çözüyoruz...</p>
        </li>
        <li>
          <h3>Tüketici Hukuku Hizmeti</h3>
          <p>Tüketici haklarınızı savunuyoruz. Satın aldığınız bir ürün ya da hizmetin, yasal şartları taşımaması...</p>
        </li>
        <li>
          <h3>Vergi Hukuku Hizmeti</h3>
          <p>Vergi yükümlülüklerinizle ilgili sorunlarınızda size yardımcı oluyoruz. Vergi daireleriyle olan anlaşmazlıklar...</p>
        </li>
        <li>
          <h3>Miras Hukuku Hizmeti</h3>
          <p>Miras paylaşımı ve miras hukuku konularında ortaya çıkan anlaşmazlıklarda uzman desteği alabilirsiniz...</p>
        </li>
        <li>
          <h3>Sağlık Hukuku Hizmeti</h3>
          <p>Sağlık hizmetleriyle ilgili yaşadığınız hukuki sorunlarda yanınızdayız. Tıbbi hatalar, sağlık sigortası anlaşmazlıkları...</p>
        </li>
        <li>
          <h3>Fikri Mülkiyet Hukuku Hizmeti</h3>
          <p>İnovasyon ve yaratıcılığınızı hukuki olarak koruyoruz. Patent, marka, tasarım ve telif hakları...</p>
        </li>
        <li>
          <h3>Uluslararası Hukuk Hizmeti</h3>
          <p>Uluslararası alandaki hukuki işlemler ve anlaşmazlıklar için uzman desteği sağlıyoruz...</p>
        </li>
      </ul>
    </section>
  );
};

export default Services;
